var fCounter = 0;

var timerId = null;

function startDynamic() {
	if (timerId == null) {
		timerId = setInterval(startDynamic, 270);
		return;
	}
	var head = document.getElementsByTagName('head')[0];
	// Найти и удалить старую иконку из тега HEAD
	var links = head.getElementsByTagName('link');
	for (var i = 0; i < links.length; i++) {
		var lnk = links[i];
		if (lnk.rel=='shortcut icon') {
			head.removeChild(lnk);
		}
	}    
	let newLink = document.createElement('link');
	newLink.rel = 'shortcut icon';
	newLink.href = faviconsArr[fCounter++];
	head.appendChild(newLink);
	if (fCounter == faviconsArr.length) {
		fCounter = 0;
	}
}

function stopDynamic() {
	if (timerId == null) {
		return;
	}
	clearTimeout(timerId);
	timerId = null;
}

/*Самовызываемая функция*/
(function (){
	startDynamic();
}());
